def create():
    if not os.path.exists(path + '\\VirusRecover'):
        os.makedirs(path + '\\VirusRecover')
    if not os.path.exists(path + '\\VirusRecover\\off1767564.png'):
        with open(path + '\\VirusRecover\\off1767564.png', 'bw') as f:
            f.write(icon_off)
    if not os.path.exists(path + '\\VirusRecover\\return56784.png'):
        with open(path + '\\VirusRecover\\return56784.png', 'bw') as f:
            f.write(icon_ret)


def registry():
    try:
        key = winreg.OpenKey(winreg.HKEY_CURRENT_USER, key_path, 0, winreg.KEY_READ)
        value_name = "theme"  # Проверяем наличие значения theme
        theme_value, _ = winreg.QueryValueEx(key, value_name)
        color_name = 'color'
        color_value, _ = winreg.QueryValueEx(key, color_name)
        language_value, _ = winreg.QueryValueEx(key, 'language')
        winreg.CloseKey(key)  # Закрываем ключ реестра
    except FileNotFoundError:
        key = winreg.CreateKey(winreg.HKEY_CURRENT_USER, key_path)
        value_name = "theme"  # Устанавливаем значение theme равным "dark"
        theme_value = "dark"
        winreg.SetValueEx(key, value_name, 0, winreg.REG_SZ, theme_value)
        color_name = 'color'
        color_value = 'blue'
        winreg.SetValueEx(key, color_name, 0, winreg.REG_SZ, color_value)
        language_value = 'EN'
        winreg.SetValueEx(key, 'language', 0, winreg.REG_SZ, language_value)
        winreg.CloseKey(key)  # Закрываем ключ реестра
    return theme_value, color_value, language_value


class App:
    def __init__(self):
        global lang
        self.theme, self.color, _ = registry()
        self.window = ctk.CTk()
        self.window_settings()
        self.window_interface()
        self.window.mainloop()

    def window_settings(self):
        ctypes.windll.shcore.SetProcessDpiAwareness(True)
        ctk.set_appearance_mode(self.theme)
        ctk.set_default_color_theme(self.color)
        self.window.title('VirusRecover')
        self.window.geometry('500x180+600+360')
        global bg_col
        if self.theme == 'dark': bg_col = 'gray17'
        else: bg_col = 'gray86'
        self.window.resizable(False, False)

    def window_interface(self):
        frame = ctk.CTkFrame(self.window, width=460, height=140)
        frame.place(x=20, y=20)

        but1 = ctk.CTkButton(frame, text=unlock, width=200, height=38, font=('Arial', 20),
                             command=lambda: Root(self.window, 'Unlock', '520x190+600+360', 'unl'))
        but1.place(x=20, y=20)

        but2 = ctk.CTkButton(frame, text=taskmgr, width=200, height=38, font=('Arial', 20),
                             command=lambda: subprocess.Popen('Taskmgr.exe'))
        but2.place(x=240, y=20)

        but3 = ctk.CTkButton(frame, text=settings, height=38, width=200, font=('Arial', 20),
                             command=lambda: Root(self.window, 'Settings', '500x180+600+360', 'set'))
        but3.place(x=20, y=80)

        but4 = ctk.CTkButton(frame, text=about, height=38, width=200, font=('Arial', 20),
                             command=lambda: Root(self.window, 'Info', '300x200+600+360', 'inf'))
        but4.place(x=240, y=80)


class Root:
    create()
    ret_icon = Image.open(path + '\\VirusRecover\\return56784.png')
    ret_icon = ctk.CTkImage(ret_icon, size=(30, 30))
    off_icon = Image.open(path + '\\VirusRecover\\off1767564.png')
    off_icon = ctk.CTkImage(off_icon, size=(30, 30))

    def __init__(self, win, title, resize, com=None):
        self.title = title
        self.resize = resize
        self.win = win
        self.com = com

        self.win.withdraw()
        self.root = ctk.CTkToplevel(self.win)
        self.root_settings()
        self.boot_theme()
        if com == 'unl':
            self.unl()
        if com == 'inf':
            self.inf()
        if com == 'set':
            self.set()
        self.root.mainloop()

    def root_settings(self):
        self.root.title(self.title)
        self.root.geometry(self.resize)
        self.root.resizable(False, False)
        self.root.protocol("WM_DELETE_WINDOW", self.ret)

